import CamelOcc from '../images/Occlusion/CamelOcclusion.jpg';
import ToucanOcc from '../images/Occlusion/ToucanOcclusion.jpg';
import GorillaOcc from '../images/Occlusion/GorillaOcclusion.jpg';
import CamelLay from '../images/LayerGradCam/CamelLGC.jpg'; //Need to decide on which layer to use
import ToucanLay from '../images/LayerGradCam/ToucanLGC.jpg'; //Need to decide on which layer to use
import GorillaLay from '../images/LayerGradCam/GorillaLGC.jpg'; //Need to decide on which layer to use
import CamelHuman from '../images/resized/Camel.jpg'; //Placeholder
import ToucanHuman from '../images/resized/Toucan.jpg'; //Placeholder
import GorillaHuman from '../images/resized/Gorilla.jpg'; //Placeholder

const GetModelImageData = (index) => {
    var modelImageData = [
        [CamelOcc],
        [ToucanOcc],
        [GorillaOcc],
        [CamelLay],
        [ToucanLay],
        [GorillaLay],
        [CamelHuman],
        [ToucanHuman],
        [GorillaHuman],
    ];
    return modelImageData[index];
}
export default GetModelImageData;
